import React from 'react';

const ResultList = (props) => {
    console.log("ResultList", props)
    const results = props.videos.map((video, index) =>
        <div className="ui card center aligned " key={index}>
            <div className="image">
                <img src={video.snippet.thumbnails.default.url} alt="Hello" ></img>
            </div>
        </div>

    )
    return results;
}

export default ResultList;
